import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Auth from './components/Auth'; // Asegúrate de tener el componente Auth
import AdjuntarBoleta from './components/AdjuntarBoleta';
import ConserjeMain from './components/ConserjeMain'; // O cualquier otro componente que tengas
import AdminCondominioMain from './components/AdminCondominioMain'; // Nuevo componente
import AdministrarCondominios from './components/AdministrarCondominios';
import AdministrarResidentes from './components/AdministrarResidentes'; // Importa el nuevo componente
import ConsultaGastosComunes from './components/ConsultaGastosComunes';
import DirectivaMain from './components/DirectivaMain';
import GestionGastosComunes from './components/GestionGastosComunes'; // Importa el nuevo componente

import './css/adjuntarBoletaStyles.css'; // Asegúrate de tener este archivo CSS
import './css/auth.css'; // Asegúrate de tener este archivo CSS
import './css/conserjeMainStyles.css'; // Asegúrate de tener este archivo CSS
import './css/adminCondominioMainStyles.css'; // Nuevo CSS para el componente Admin
import './css/administrarCondominiosStyles.css';
import './css/administrarUsuariosStyles.css'; // Nuevo CSS para el componente de residentes
import './css/gestionGastosComunesStyles.css'; // Asegúrate de tener este archivo CSS para el nuevo componente

const App = () => {
    return (
        <Router>
            <Routes>
                <Route path="/auth" element={<Auth />} />
                <Route path="/adjuntar-boleta" element={<AdjuntarBoleta />} />
                <Route path="/conserje-main" element={<ConserjeMain />} />
                <Route path="/admin-condominio" element={<AdminCondominioMain />} /> {/* Nueva ruta */}
                <Route path="/administrar-condominios" element={<AdministrarCondominios />} />
                <Route path="/administrar-residentes" element={<AdministrarResidentes />} /> {/* Nueva ruta */}
                <Route path="/consulta-gastos-comunes" element={<ConsultaGastosComunes />} />
                <Route path="/directiva" element={<DirectivaMain />} />
                <Route path="/gestion-gastos-comunes" element={<GestionGastosComunes />} /> {/* Nueva ruta para GestionGastosComunes */}
            </Routes>
        </Router>
    );
};

export default App;
